const initialState = {
    names:  [],
    newList: [{name: "Joe"}, {name: "Mikael"}],
};

function rootReducer(state = initialState, action){
    switch(action.type){
        case "CHANGE_POOP_TO_DUCK": 
            return {newList: "ran"};
        default:
            return state
    }
}

export default rootReducer;
